    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 + - col1 * + col2 NOT IN ( - + col2, col1, 14 + - 51, - 10, col0, + - col2 * + col0 );
  - name: tab2

outputs:
  - name: q9855.out
    data: |
      46	51	23
      64	77	40
      75	67	58
